import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGear } from '@fortawesome/free-solid-svg-icons'
import { bgColor5e } from '../Styles/backGroundColor'

export function IconButton(props){
    const {width=35, height=35, color="white", bgColor=bgColor5e} = props

    return (
    <div style={{width:width, height:height, backgroundColor:bgColor}}>
        <FontAwesomeIcon icon={faGear} style={{color:color,}} />
    </div>)
}
